import React from "react";
import InputMask from "react-input-mask";
// import {
//     BrowserRouter as Link
// } from "react-router-dom";
import "./App.css";
import { Form } from "react-bootstrap/Form";
// import FormControl from "react-bootstrap/FormControl";
// import FormCheck from "react-bootstrap/FormCheck";
import { Button } from "react-bootstrap/Button";
// fetch("/api/signup", {
//   method: "POST",
//   body:
//     "'username', 'password', 'name', 'occupation', 'address', 'phoneNumber', 'email'"
// });

export default function SignUp() {
  return (
    <Form>
      <Form.Row>
        <Form.Group as={Col} controlId="formGridEmail">
          <Form.Label>Email</Form.Label>
          <Form.Control type="email" placeholder="Enter email" />
        </Form.Group>

        <Form.Group as={Col} controlId="formGridPassword">
          <Form.Label>Password</Form.Label>
          <Form.Control type="password" placeholder="Password" />
        </Form.Group>
      </Form.Row>

      <Form.Group controlId="formGridAddress1">
        <Form.Label>Address</Form.Label>
        <Form.Control placeholder="1234 Main St" />
      </Form.Group>

      <Form.Group controlId="formGridAddress2">
        <Form.Label>Address 2</Form.Label>
        <Form.Control placeholder="Apartment, studio, or floor" />
      </Form.Group>

      <Form.Row>
        <Form.Group as={Col} controlId="formGridCity">
          <Form.Label>City</Form.Label>
          <Form.Control />
        </Form.Group>

        <Form.Group as={Col} controlId="formGridState">
          <Form.Label>State</Form.Label>
          <Form.Control as="select">
            <option>Choose...</option>
            <option>...</option>
          </Form.Control>
        </Form.Group>

        <Form.Group as={Col} controlId="formGridZip">
          <Form.Label>Zip</Form.Label>
          <Form.Control />
        </Form.Group>
      </Form.Row>

      <Form.Group id="formGridCheckbox">
        <Form.Check type="checkbox" label="Check me out" />
      </Form.Group>

      <Button variant="primary" type="submit">
        Submit
      </Button>
    </Form>
    // <div class="login-header">
    //   <h2>Sign Up</h2>
    //   <form onSubmit="fetch">
    //     <label for="username">Username:{"  "}</label>
    //     <input id="login-box" type="username" name="username" required></input>
    //     <br />
    //     <label for="password">Password:</label>
    //     <input id="login-box" type="password" name="password" required></input>
    //     <br />
    //     <label for="name">Full Name:</label>
    //     <input
    //       id="login-box"
    //       type="text"
    //       name="name"
    //       placeholder="ex. John Doe"
    //       required
    //     ></input>
    //     <br />
    //     <label for="occupation">Company/School: </label>
    //     <input id="login-box" type="text" name="occupation" required></input>
    //     <br />

    //     <label for="email">Email: </label>
    //     <input
    //       id="login-box"
    //       type="email"
    //       name="email"
    //       placeholder="ex. john.doe@email.com"
    //       required
    //     ></input>
    //     <br />
    //     <label for="phoneNumber">Phone: </label>
    //     <InputMask
    //       id="login-box"
    //       type="tel"
    //       name="phoneNumber"
    //       mask="(999) 999-9999"
    //       placeholder="ex. (123) 456-7890"
    //       required
    //     ></InputMask>
    //     <br />
    //     <label for="address">Address: </label>
    //     <input id="login-box" type="address" name="address" required></input>
    //     <br />
    //     <input type="submit" value="Sign Up"></input>
    //   </form>
    // </div>
  );
}
